import s from './NewsFilter.module.css';

const NewsFilter = () => {
	return (
		<div className={s.filters}>
			<div className={s.filters_row}>
				<button>Усі</button>
				<button>Сьогодні</button>
				<button>Популярне</button>
			</div>
			<div className={s.filters_row}></div>
		</div>
	);
};

export default NewsFilter;
